import React, { useState } from 'react'
import { UserNav } from '../../component/Navbar/homeNav'
import './AddDesign.css'
import { revealVote } from '../../data/data'
import Select from 'react-select'

export default function AddDesign(){

    const stating=[
        {value:"0", label:"none"},
        {value:"1", label:"first"},
        {value:"2", label:"second"}
    ]

    const [filehash,SetHash] = useState();
    const [vendor,setVendor] = useState("");
    const [balance,SetBalance] = useState();
    const [manager,SetManager] = useState("");
    

    const [status,SetStatus] =useState([]);


/*
    <Select isMulti
                      options={material}
                      getOptionValue={(option)=>option.value}
                      onChange={(option)=>{handleChangeMats(option);
                      }}
                      />
*/

const handleChangeState=(option)=>{
    let values=[]
    option.map((value)=>{
        values.push(parseInt(value.value));
        
    })
    SetStatus(values);
    console.log(values)
}

const handleSubmit = async(event)=>{
    event.preventDefault();
    //let stateobj = {name: Name, materiale: materiale, colors: colors,quantityKG: quantityKG, printTemp: printTemp, bedTemp: bedTemp}
    //console.log(stateobj)
    //await onBoarding.addMaterial(matobj)
    console.log("Hello")
    }

  return (
    <div className='sign'>
        <UserNav/>

        <h1>Add Design</h1>
        <div className='SignIn'>
            
            <label>
                <p>FileHash</p>
                <input type="text" placeholder='filehash'/>
            </label>

            <label>
                <p>Vendor</p>
                <input type="text" placeholder='Address'/>
            </label>

            <label>
                <p>Balance</p>
                <input type="number" placeholder='balance'/>
            </label>

            <label>
                <p>Manager</p>
                <input type="text" placeholder='Address'/>
            </label>

            <label>
                <p>StatusPhase</p>
                <Select isMulti
                      options={stating}
                      getOptionValue={(option)=>option.value}
                      onChange={(option)=>{handleChangeState(option);
                      }}
                      />
            </label>

            <label>
                <p>taup</p>
                <input type="number" placeholder='taup'/>
            </label>

            <label>
                <p>taur</p>
                <input type="number" placeholder='taur'/>
            </label>

            <label>
                <p>deltaExp</p>
                <input type="number" placeholder='deltaExp'/>
            </label>

            <label>
                <p>deltaReveal</p>
                <input type="number" placeholder='deltaReveal'/>
            </label>

            <label>
                <p>Result 1</p>
            </label>

            <label>
                <p>phase</p>
            </label>
            <button className="printerButton" onClick={handleSubmit}>Add Design</button>



        </div>

    </div>
  )
}
